function handleEditAvatarClick() {
  document.querySelector('.popup_type_avatar').classList.add('popup_opened');
}

function handleEditProfileClick() {
  document.querySelector('.popup_type_edit').classList.add('popup_opened');
}

function handleAddPlaceClck() {
  document.querySelector('.popup_type_add').classList.add('popup_opened');
}

function Main(props) {
  return(
    <main class="content">
      <section class="profile" aria-label="Профиль">
        <div class="profile__pseudo" onClick={props.onEditAvatar} >
          <img src="#" alt="аватар профиля" class="profile__image" />
        </div>
        <div class="profile__info">
          <div class="profile__wrapper">
            <h1 class="profile__name"></h1>
            <button class="profile__edit-button" type="button" onClick={ handleEditProfileClick } aria-label="Кнопка редактирования"></button>
          </div>
          <p class="profile__signature"></p>
        </div>
        <button class="profile__add-button" type="button" onClick={ handleAddPlaceClck } aria-label="Кнопка добавления карточки"></button>
      </section>
      <section aria-label="Элементы">
        <ul class="elements">
          <template id="card">
            <li class="element">
              <img  class="element__image" />
              <button class="element__delete-button" type="button" aria-label="Кнопка удаления карточки"></button>
              <div class="element__wrapper">
                <h2 class="element__title"></h2>
                <div class="element__like">
                  <button class="element__heart" type="button" aria-label="Кнопка лайка"></button>
                  <p class="element__amount"></p>
                </div>
              </div>
            </li>
          </template>
        </ul>
      </section>
    </main>
  )
}

export default Main;
